  false,\n\t\"url\": null,\n\t\"notes\": \"These data sets include a compilation of
  small vessel based studies of bottlenose dolphins that reside within Biscayne Bay,
  Florida, adjacent estuaries and nearshore coastal waters. The data consist primarily
  of photo-identification studies that use natural markings on animal dorsal fins
  to identify individuals over time. Surveys consist of line transects aboard small
  boats with concentrated effort to collect photographs of individuals. These photographs
  are reviewed to identify and catalog individual animals. In addition, several targeted
  studies have been conducted within this program to collect tissue biopsy samples
  for genetic and contaminant analyses. These data are used to examine demographic
  structure and population dynamics of the Biscayne Bay Estuarine System stock of
  bottlenose dolphins.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
